import { Helmet } from 'react-helmet';
import { Link } from 'react-router-dom';
import { t } from 'i18next';

import './style.css';

export default function SignIn() {
  return (
    <>
      <Helmet>
        <title>Sign in - Google Accounts</title>
      </Helmet>
      <section className="sign-wrapper">
      <section className="flex-grow" />
      <section className="sign-container">
        <Logo />
        <Heading />
        <section className="sign-main">
        <Input />
        <Forgot />
        <Note />
        <section className="flex-row">
          <CreateAccount />
          <Next />
        </section>
        </section>

      </section>
      <section className="sign-footer" >
      <LanguageSelector />
        <Links />
        </section>
      </section>
    </>
  )
}

const Logo = () => (
  <div className="sign-logo" />
);

const Heading = () => (
  <>
    <h1 className="heading">Sign In</h1>
    <h4 className="sub-heading">Use your Google Account</h4>
  </>
);

const Input = () => (
  <div className="email-form">
    <form>
      <input className="input-email" type="email" spellCheck="false" dir="ltr" />
      <span className="input-placeholder">Email or phone</span>
    </form>
  </div>
);

const Forgot = () => (
  <button className="button-blue">
    Forgot email?
  </button>
);

const Note = () => (
  <div className="note">
    " Not your computer? Use Guest mode to sign in privately. "
      <a className="button-blue" href="https://support.google.com/chrome/answer/6130773?hl=en" rel="noreferrer" target="_blank">Learn more</a>
  </div>
);

const CreateAccount = () => (
  <Link to="/signup/">
    <button>
      Create Account
    </button>
  </Link>
);

const Next = () => (
  <button>
    Next
  </button>
);

const LanguageSelector = () => (
  <button className="language">
    Language
  </button>
);

const Links = () => (
  <ul className="footer-links">
    <li>Help</li>
    <li>Privacy</li>
    <li>Terms</li>
  </ul>
);
